import './styles.css';
import Header from './Header.js';
import BoardHeader from "./BoardHeader.js"
import PostForm from "./PostForm.js"

function App() {
  return (
    <div>
        <Header/>
        <BoardHeader/>
        <PostForm/>
        <div className="border border-reddit_boorder bg-reddit_dark-brighter">
          <h2>
            CBU is a place where new relationships, friends and etec are being made
          </h2>
        </div>
    </div>
  );
}

export default App;
